public class LogisticsLocationSelect extends FormRun
{
    SysFormEnumComboBox             sourceTypeEnumComboBox;
    LogisticsLocationSelectForm     selectForm;
    FormDataSource                  activeTopDataSource;
    LogisticsPostalAddressRecId     postalAddressRecId;

}

public boolean canClose()
{
    boolean ret;

    ret = super();

    if (ret &&
        element.closedOk() &&
        BrazilParameters::isEnabled() &&
        !element.isSelectedAddressValid_BR())
    {
        ret = checkFailed("@GlobalAddressBook:TheCityOfSelectedAddressMustBeInCityTable");
    }

    return ret;
}

private void innerJoinAddress(QueryBuildDataSource _qbdLocal, LogisticsPostalAddressRecId _address)
{
    _qbdLocal.joinMode(JoinMode::InnerJoin);
    QueryBuildRange range = _qbdLocal.addRange(fieldNum(LogisticsPostalAddress, RecId));
    range.value(int642str(_address));
}

/// <summary>
/// Adds ranges to <c>LogisticsPostalAddress</c> data source based on <c>LogisticsLocationSelectSourceType</c> selection.
/// </summary>
/// <param name = "_qbdLogisticsPostalAddress">The <c>QueryBuildDataSource</c> representing <c>LogisticsPostalAddress</c>.</param>
protected void addRangeToLogisticsPostalAddress(QueryBuildDataSource _qbdLogisticsPostalAddress)
{
    switch (any2Enum(sourceTypeEnumComboBox.selection()))
    {
        case LogisticsLocationSelectSourceType::SalesQuotation :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, salesQuotationTable.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::SalesQuotationLine :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, salesQuotationLine.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::SalesOrder :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, salesTable.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::SalesLine :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, salesLine.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::RequestForQuote :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, purchRFQCaseTable.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::RequestForQuoteLine :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, purchRFQCaseLine.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::ServiceOrder :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, smaServiceOrderTable.ServicePostalAddress);
            break;

        case LogisticsLocationSelectSourceType::PurchaseOrder :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, purchTable.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::PurchaseOrderLine :
            element.innerJoinAddress(_qbdLogisticsPostalAddress, purchLine.DeliveryPostalAddress);
            break;

        case LogisticsLocationSelectSourceType::PurchReqLine :
            element.innerjoinAddress(_qbdLogisticsPostalAddress, purchReqLine.DeliveryPostalAddress);
            break;
    }
}

/// <summary>
/// Adds ranges to <c>LogisticsLocation</c> data source based on <c>LogisticsLocationSelectSourceType</c> selection.
/// </summary>
/// <param name = "_qbdLocation">The <c>QueryBuildDataSource</c> representing <c>LogisticsLocation</c>.</param>
protected void addRangeToLogisticsLocation(QueryBuildDataSource _qbdLocation)
{
    QueryBuildRange range;
    QueryBuildDataSource qbd;

    switch (any2enum(sourceTypeEnumComboBox.selection()))
    {
        case LogisticsLocationSelectSourceType::Project :
            range = SysQuery::findOrCreateRange(_qbdLocation, fieldNum(LogisticsLocation, RecId));
            range.value(SysQuery::value(projTable.DeliveryLocation));
            break;

        case LogisticsLocationSelectSourceType::Site :
            qbd = _qbdLocation.addDataSource(tableNum(InventSiteLogisticsLocation));
            qbd.relations(true);
            qbd.joinMode(JoinMode::ExistsJoin);

            range = qbd.addRange(fieldNum(InventSiteLogisticsLocation, Site));
            range.value(int642str(inventSite.RecId));
            break;

        case LogisticsLocationSelectSourceType::Warehouse :
            qbd = _qbdLocation.addDataSource(tableNum(InventLocationLogisticsLocation));
            qbd.relations(true);
            qbd.joinMode(JoinMode::ExistsJoin);

            range = qbd.addRange(fieldNum(InventLocationLogisticsLocation, InventLocation));
            range.value(int642str(inventLocation.RecId));
            break;

        case LogisticsLocationSelectSourceType::BusinessRelation :
        case LogisticsLocationSelectSourceType::Customer :
        case LogisticsLocationSelectSourceType::Vendor :
        case LogisticsLocationSelectSourceType::Company :
            qbd = _qbdLocation.addDataSource(tableNum(DirPartyLocation));
            qbd.relations(true);
            qbd.joinMode(JoinMode::ExistsJoin);

            range = qbd.addRange(fieldNum(DirPartyLocation, Party));
            range.value(int642str(element.visiblePartyRecId()));

            range = qbd.addRange(fieldNum(DirPartyLocation, IsPrivate));
            range.value(SysQuery::value(NoYes::No));

            qbd = qbd.addDataSource(tableNum(DirPartyLocationRole));
            qbd.relations(true);
            qbd.joinMode(JoinMode::ExistsJoin);

            range = qbd.addRange(fieldNum(DirPartyLocationRole, LocationRole));
            range.value(SysQuery::valueNot(LogisticsLocationRole::findBytype(
                    LogisticsLocationRoleType::OneTime).RecId));

            break;
        case LogisticsLocationSelectSourceType::PurchReqLineRequsterHCMWorker :
            qbd = _qbdLocation.addDataSource(tableNum(DirPartyLocation));
            qbd.relations(true);
            qbd.joinMode(JoinMode::InnerJoin);

            range = qbd.addRange(fieldNum(DirPartyLocation, Party));
            range.value(int642str(element.visiblePartyRecId()));

            range = qbd.addRange(fieldNum(DirPartyLocation, IsPrivate));
            range.value(SysQuery::value(NoYes::No));

            break;
    }
}

public void closeOk()
{
    PurchRFQCaseTable                           purchRFQCaseTableLoc;
    PurchRFQCaseLine                            purchRFQCaseLineLoc;
    PurchRFQTable                               purchRFQTableLoc;
    PurchRFQLine                                purchRFQLineLoc;
    LogisticsLocationSelectForm_RFQCaseTable    locationSelectRFQCaseTable;
    LogisticsLocationSelectForm_RFQCaseLine     locationSelectRFQCaseLine;
    LogisticsLocationSelectForm_RFQTable        locationSelectRFQTable;
    LogisticsLocationSelectForm_RFQLine         locationSelectRFQLine;

    super();

    // Copy address to calling record
    // <GBR>
    if (BrazilParameters::isEnabled() &&
        element.isSelectedAddressValid_BR())
    {
        switch (classIdGet(selectForm))
        {
            case classNum(LogisticsLocationSelectForm_PurchReqLine):
                if (CFOPValidation_BR::validateDeliveryAddress(purchReqLine.inventDim().inventSite().fiscalEstablishment(), logisticspostaladdress.RecId))
                {
                    selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                }
                break;

            case classNum(LogisticsLocationSelectForm_RFQCaseTable):
                locationSelectRFQCaseTable = selectform as LogisticsLocationSelectForm_RFQCaseTable;
                purchRFQCaseTableLoc = locationSelectRFQCaseTable.getMainTableBuffer_BR();
                if (purchRFQCaseTableLoc.InventSiteId && CFOPValidation_BR::validateDeliveryAddress(InventSite::find(purchRFQCaseTableLoc.InventSiteId).fiscalEstablishment(), logisticspostaladdress.RecId))
                {
                    selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                }
                break;

            case classNum(LogisticsLocationSelectForm_RFQCaseLine):
                locationSelectRFQCaseLine = selectform as LogisticsLocationSelectForm_RFQCaseLine;
                purchRFQCaseLineLoc = locationSelectRFQCaseLine.getMainTableBuffer_BR();
                if (CFOPValidation_BR::validateDeliveryAddress(purchRFQCaseLineLoc.inventDim().inventSite().fiscalEstablishment(), logisticspostaladdress.RecId))
                {
                    selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                }
                break;
            case classNum(LogisticsLocationSelectForm_RFQTable):
                locationSelectRFQTable = selectform as LogisticsLocationSelectForm_RFQTable;
                purchRFQTableLoc = locationSelectRFQTable.getMainTableBuffer_BR();
                if (purchRFQTableLoc.InventSiteId && CFOPValidation_BR::validateDeliveryAddress(InventSite::find(purchRFQTableLoc.InventSiteId).fiscalEstablishment(), logisticspostaladdress.RecId))
                {
                    selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                }
                break;

            case classNum(LogisticsLocationSelectForm_RFQLine):
                locationSelectRFQLine = selectform as LogisticsLocationSelectForm_RFQLine;
                purchRFQLineLoc = locationSelectRFQLine.getMainTableBuffer_BR();
                if (CFOPValidation_BR::validateDeliveryAddress(purchRFQLineLoc.inventDim().inventSite().fiscalEstablishment(), logisticspostaladdress.RecId))
                {
                    selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                }
                break;

            default:
                selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
                break;
        }
    }
    else
    {
        // </GBR>
        selectForm.copyAddressToCaller(element.parmActiveTopDS().cursor(), logisticsPostalAddress.RecId);
        selectForm.updateAddressName(logisticsPostalAddress.RecId);
        // <GBR>
    }
    // </GBR>

    this.closeHostLookupForm();
}

public void executeQueryLogisticsLocation(TableId _callingDataSourceTableId)
{
    // No default source type needed, pass in 0
    if (sourceTypeEnumComboBox.selection() ==
        enum2int(LogisticsLocationSelectForm::tableIdToSourceType(_callingDataSourceTableId, any2Enum(sourceTypeEnumComboBox.selection()))))
    {
        logisticsLocation_ds.executeQuery();
    }
}

public void init()
{
    LogisticsLocationSelectSourceType selectType;
    Set allowedSourcesConfigCleanup = new Set(Types::Enum);
    SetEnumerator enumerator;
    boolean showLocalComboBox = true;

    // If caller implements LogisticsPostalAddressISelector then this form is being called from within a lookup form.
    LogisticsPostalAddressISelector postalAddressSelector = this.args().caller() as LogisticsPostalAddressISelector;
    if (postalAddressSelector)
    {
        selectForm = postalAddressSelector.getLogisticsLocationSelectForm();
        postalAddressRecId = selectForm.getLogisticsPostalAddressRecId();

        // Lookup form may provide it's own source type combo box.
        FormComboBoxControl sourceTypeCombo = postalAddressSelector.getSourceTypeComboBox();
        if (sourceTypeCombo)
        {
            sourceTypeCombo.OnSelectionChanged += eventhandler(this.sourceTypeSelectionChanged);
            sourceTypeEnumComboBox = postalAddressSelector.getSourceEnumComboBox();
            showLocalComboBox = false;
        }
        this.selectRecordModeSelectedRecord(LogisticsPostalAddress);
    }
    else
    {
        // If not called from a lookup form then the caller must provide the postal address RecId and select form interaction class.
        postalAddressRecId = str2int64(this.args().parm());
        selectForm = this.args().parmObject() as LogisticsLocationSelectForm;

        // Adjust design to dialog style if not used within a lookup.
        FormBuildDesign formBuildDesign = this.form().design();
        formBuildDesign.style(FormStyle::Dialog);
        formBuildDesign.frame(FormFrame::Dialog);
        formBuildDesign.windowType(FormWindowType::Slider);
        formBuildDesign.statusBarStyle(StatusBarStyle::Auto);
        formBuildDesign.dialogSize(SysDialogSize::Full);
    }

    allowedSourcesConfigCleanup = selectForm.allowedSourcesWithConfigKeyEnabled();

    if (!sourceTypeEnumComboBox)
    {
        sourceTypeEnumComboBox = SysFormEnumComboBox::newParameters(element,
            element.controlId(formControlStr(LogisticsLocationSelect, ComboBoxSourceType)),
            enumNum(LogisticsLocationSelectSourceType),
            allowedSourcesConfigCleanup);
    }

    super();

    ComboBoxSourceType.visible(showLocalComboBox);
    selectType = selectForm.defaultSource();

    if (!allowedSourcesConfigCleanup.in(selectType))
    {
        enumerator = allowedSourcesConfigCleanup.getEnumerator();
        enumerator.moveNext();
        selectType = enumerator.current();
    }

    sourceTypeEnumComboBox.select(enum2int(selectType));
    this.showSourceData(selectType);
}

public boolean isSelectedAddressValid_BR()
{
    #ISOCountryRegionCodes

    if (LogisticsAddressCountryRegion::find(logisticsPostalAddress.CountryRegionId).isOcode == #isoBR &&
        (!logisticspostaladdress.City ||
         !LogisticsAddressCity::findLogisticsAddressMap(logisticsPostalAddress)))
    {
        return false;
    }
    return true;
}

FormDataSource parmActiveTopDS(FormDataSource _formDS = activeTopDataSource)
{
    activeTopDataSource = _formDS;

    if (activeTopDataSource == null)
    {
        activeTopDataSource = this.selectedDataSource();
    }

    return activeTopDataSource;
}

private FormDataSource selectedDataSource()
{
    int i = 0;
    TableId tableId;
    FormDataSource formDataSource;

    tableId = LogisticsLocationSelectForm::sourceTypeToTableId(any2Enum(sourceTypeEnumComboBox.selection()));

    do
    {
        formDataSource = this.dataSource(i);
        i++;
    } while (formDataSource.table() != tableId);

    return formDataSource;
}

public void showSourceData(LogisticsLocationSelectSourceType _source)
{
    SysDictEnum dictEnum = new SysDictEnum(enumNum(LogisticsLocationSelectSourceType));
    int value, tabIndex, selectedTab;

    // Show correct grid tab, details group tab.
    value = dictEnum.firstValue();
    tabIndex = 1;

    do
    {
        LogisticsLocationSelectSourceType currentType = any2enum(value);
        if (tabIndex <= tabGrids.controlCount())
        {
            // Show Hide tabs.
            tabGrids.controlNum(tabIndex).visible(_source == currentType);
            tabDetails.controlNum(tabIndex).visible(_source == currentType);
        }

        if (_source == currentType)
        {
            selectedTab = tabIndex;
        }

        tabIndex++;
        value = dictEnum.nextValue(value);

    } while (value != dictEnum.firstValue());

    tabGrids.tab(selectedTab);
    tabDetails.tab(selectedTab);
}

public RecId visiblePartyRecId()
{
    switch (any2Enum(sourceTypeEnumComboBox.selection()))
    {
        case LogisticsLocationSelectSourceType::BusinessRelation :
            return smmBusRelTable.Party;
        case LogisticsLocationSelectSourceType::Customer :
            return custTable.Party;
        case LogisticsLocationSelectSourceType::Vendor :
            return vendTable.Party;
        case LogisticsLocationSelectSourceType::Company :
            return companyInfo.RecId;
        case LogisticsLocationSelectSourceType::PurchReqLineRequsterHCMWorker :
            return purchReqLineRequsterHCMWorker.Person;
    }
    return 0;
}

private DirPartyLocationRoleNames inventLocationRoles(LogisticsLocation _logisticsLocation)
{
    DirPartyLocationRoleNames   locationRoleNames;
    switch (any2Enum(sourceTypeEnumComboBox.selection()))
    {
        case LogisticsLocationSelectSourceType::Site:
            InventSiteLogisticsLocation inventSiteLogisticsLocation;
            select firstonly RecId from  inventSiteLogisticsLocation where inventSiteLogisticsLocation.Location == _logisticsLocation.RecId;
            locationRoleNames = inventSiteLogisticsLocation.locationRoleNames();
            break;

        case LogisticsLocationSelectSourceType::Warehouse:
            InventLocationLogisticsLocation inventLocationLogisticsLocation;
            select firstonly RecId from  inventLocationLogisticsLocation where inventLocationLogisticsLocation.Location == _logisticsLocation.RecId;
            locationRoleNames = inventLocationLogisticsLocation.locationRoleNames();
            break;
    }
    return locationRoleNames;
}

private void sourceTypeSelectionChanged(FormControl _sender, FormControlEventArgs _args_selectSourceType)
{
    element.showSourceData(any2Enum(sourceTypeEnumComboBox.selection()));
    logisticsLocation_ds.executeQuery();
}

/// <summary>
/// When this form is hosted in another lookup form we must signal the host that we intend to close it
/// otherwise the lookup will remain open even after a selection is made.
/// </summary>
private void closeHostLookupForm()
{
    if (element.args() && element.args().caller() is LogisticsPostalAddressISelector)
    {
        FormRun lookupHostForm = element.args().caller() as FormRun;
        if (lookupHostForm)
        {
            lookupHostForm.close();
        }
    }
}

display public DirPartyLocationRoleNames locationRoles(LogisticsLocation _logisticsLocation)
{
    if ((any2Enum(sourceTypeEnumComboBox.selection()) == LogisticsLocationSelectSourceType::Site || 
         any2Enum(sourceTypeEnumComboBox.selection()) == LogisticsLocationSelectSourceType::Warehouse))
    {
        return element.inventLocationRoles(_logisticsLocation);
    }
    else
    {
        DirPartyLocation dirPartyLocation;
        select firstonly RecId from dirPartyLocation where dirPartyLocation.Location == _logisticsLocation.RecId && dirPartyLocation.Party == element.visiblePartyRecId();
        return dirPartyLocation.locationRoleNames();
    }

}

public void executeQuery()
{
    LogisticsLocationRecId      locationRecId;
    Query                       query = new Query();
    QueryBuildDataSource        qbd, qbdLocation;
    QueryBuildRange             range;


    // Update query based on selection
    qbdLocation = query.addDataSource(tableNum(LogisticsLocation));
    range = SysQuery::findOrCreateRange(qbdLocation, fieldNum(LogisticsLocation, IsPostalAddress));
    range.value(SysQuery::value(NoYes::Yes));

    element.addRangeToLogisticsLocation(qbdLocation);

    qbd = qbdLocation.addDataSource(tableNum(LogisticsPostalAddress));
    qbd.relations(true);
    qbd.joinMode(JoinMode::InnerJoin);

    element.addRangeToLogisticsPostalAddress(qbd);

    this.query(query);

    super();

    if (postalAddressRecId)
    {
        locationRecId = LogisticsPostalAddress::findRecId(postalAddressRecId).Location;
        if (locationRecId)
        {
            // make the location/address currently in use the selected one in the "GridAddress" grid:
            logisticsLocation_ds.positionToRecord(LogisticsLocation::find(locationRecId));
        }
    }
}

